      SELECT DISTINCT - 91 AS col0 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet);
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q1992.out
    data: |
      -91
